Cira na fb: https://www.facebook.com/cira1983 Zamów album "Głodni Z Natury" 2CD na http://www.preorder.pl/muzyka/hip-hop-polska/hukos-cira-glodni-z-natury

"Polska Ulewa" to solowy utwór białostockiego rapera Ciry, który zasili tracklistę wspólnej płyty z Hukosem zatytułowanej "Głodni Z Natury". To także osobisty bunt muzyka przeciwko rozpasanej scenie politycznej i patologicznej strukturze zachowań polskiego społeczeństwa.

"Już słyszę i widzę te potoki komentarzy, hejtów i posądzeń o populizm. Nie interere mnie to. Nie jestem politycznym raperem, ale od pewnego czasu wzbierała we mnie żółć, gdy obserwowałem polski sejm, społeczeństwo i nas samych. Ten numer to rzyg, najprawdopodobniej jednorazowy." - mówi nam raper. "Nie chodzi mi w tym kawałku o piętnowanie akurat TYCH ludzi. Na dobrą sprawę taki track mógłby mieć sto zwrotek. Ulewa jako oczyszczenie. Moknijmy." - kończy Cira.

W nagraniu "Polska Ulewa" został wykorzystany fragment utworu Anny Jantar "Jak w taki dzień deszczowy". Singiel promuje album "Głodni Z Natury", który ukaże się na rynku 21 czerwca 2013 roku. Płyta w wersji 2CD dostępna jest w przedsprzedaży na http://www.preorder.pl.

